import React from 'react';
import { NavLink } from 'react-router-dom';

function Navbar() {
  // Style object for active navigation link
  const activeStyle = {
    fontWeight: "bold",
    color: "blue"
  };

  return (
    <nav style={{marginBottom: '1rem'}}>
      <NavLink to="/" exact activeStyle={activeStyle} style={{marginRight: '10px'}}>Home</NavLink>
      <NavLink to="/manage-games" activeStyle={activeStyle}>Manage Games</NavLink>
      {/* Add additional NavLink elements for other routes as needed */}
    </nav>
  );
}

export default Navbar;
